svg.script:

document.addEventListener('DOMContentLoaded', function() {
    document.getElementById('bebButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Baterai EV Bekas', p: 'Baterai EV bekas yang menjadi input dalam proses daur ulang ini adalah baterai lithium-ion yang telah mencapai akhir masa pakainya dari kendaraan listrik (Electric Vehicle). Baterai ini umumnya mengandung komponen logam berharga seperti lithium (Li), nikel (Ni), kobalt (Co), mangan (Mn), serta logam lain seperti aluminium (Al) dan besi (Fe).' }, '*');
    });
    document.getElementById('ddButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Discharging & Disassembly', p: 'Discharging & disassembly adalah tahap awal dalam proses daur ulang baterai EV bekas dimana baterai akan dikosongkan terlebih dahulu muatan listriknya (discharging) untuk alasan keamanan, karena baterai yang masih memiliki muatan listrik dapat berbahaya saat proses pembongkaran. Setelah baterai benar-benar kosong, dilakukan pembongkaran (disassembly) untuk memisahkan komponen-komponen baterai seperti casing, separator, elektrolit, dan material aktif. Proses ini harus dilakukan dengan hati-hati dan mengikuti prosedur keselamatan yang ketat karena baterai lithium-ion mengandung bahan-bahan yang berpotensi berbahaya jika tidak ditangani dengan benar.' }, '*');
    });
    document.getElementById('mcButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Mechanical Crusher', p: 'Mechanical crushing adalah proses penghancuran fisik komponen baterai yang telah dibongkar menggunakan alat penghancur mekanik untuk memperkecil ukuran material menjadi partikel-partikel yang lebih kecil. Proses ini penting untuk memudahkan pemisahan dan pengolahan material pada tahap-tahap selanjutnya dalam proses daur ulang baterai.' }, '*');
    });
    document.getElementById('ssButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Sieve Screener', p: 'Sieve screener adalah proses penyaringan material hasil penghancuran menggunakan ayakan dengan ukuran mesh tertentu untuk memisahkan partikel berdasarkan ukurannya. Material yang masih terlalu besar akan dikembalikan ke proses mechanical crushing, sementara material yang sudah sesuai ukurannya akan dilanjutkan ke proses leaching reactor.' }, '*');
    });
    document.getElementById('lrButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Leaching Reactor', p: 'Leaching reactor adalah proses ekstraksi kimia dimana material hasil ayakan direaksikan dengan asam sulfat (H2SO4) untuk melarutkan logam-logam berharga yang terkandung dalam material baterai. Proses ini bertujuan untuk memisahkan dan mengambil logam-logam seperti lithium, nikel, kobalt, dan mangan dari material padat menjadi bentuk larutan yang lebih mudah untuk diproses pada tahap selanjutnya.' }, '*');
    });
    document.getElementById('stmButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Settling Tank Mn', p: 'Settling Tank Mn adalah tangki pengendapan yang berfungsi untuk memisahkan mangan (Mn) dari larutan hasil leaching dengan penambahan kalium permanganat (KMnO4). Dalam proses ini, mangan akan mengendap dalam bentuk MnO2 (mangan dioksida) yang kemudian dapat dipisahkan dari larutan, sementara logam-logam lain seperti lithium, nikel, dan kobalt tetap berada dalam larutan untuk diproses lebih lanjut.' }, '*');
    });
    document.getElementById('afseButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Al & Fe Solvent Extraction', p: 'Al & Fe Solvent Extraction adalah proses pemisahan aluminium (Al) dan besi (Fe) dari larutan menggunakan pelarut organik D2EHPA dengan konsentrasi 10%. Dalam proses ini, Al dan Fe akan terekstrak ke dalam fase organik sementara logam-logam berharga lainnya tetap dalam fase air. Hasil ekstraksi berupa loaded organic yang mengandung Al dan Fe akan dipisahkan untuk pengolahan lebih lanjut, sementara fase air yang mengandung logam berharga lainnya akan dilanjutkan ke proses pemisahan berikutnya.' }, '*');
    });
    document.getElementById('cseButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Co Solvent Extraction', p: 'Co Solvent Extraction adalah proses pemisahan kobalt (Co) dari larutan menggunakan pelarut organik PC-88A dengan konsentrasi 60% Na 0.56 M. Dalam proses ini, kobalt akan terekstrak secara selektif ke dalam fase organik, kemudian melalui proses stripping menggunakan H2SO4 untuk menghasilkan CoSO4 (kobalt sulfat). Penggunaan PC-88A sebagai extractant membantu meningkatkan selektivitas dan efisiensi pemisahan kobalt dari logam-logam lainnya dalam larutan. Proses ini merupakan tahap penting dalam pemurnian logam berharga dari baterai bekas, dimana kobalt yang dihasilkan dapat digunakan kembali dalam pembuatan baterai baru.' }, '*');
    });
    document.getElementById('lnscButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Li, Ni Scrubber Column', p: 'Li, Ni Scrubber Column adalah kolom pemisahan dimana aliran raffinate yang keluar dari bagian bawah kolom (mengandung Li dan Ni) akan didaur ulang kembali ke proses Co Solvent Extraction, sementara aliran yang keluar dari bagian atas kolom mengandung larutan cobalt yang akan diteruskan ke proses Co Stripping Column untuk pemurnian lebih lanjut menjadi CoSO4. Proses ini memastikan pemisahan yang efisien dan pemanfaatan kembali komponen yang belum sepenuhnya terpisah.' }, '*');
    });
    document.getElementById('cscButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Co Stripping Column', p: 'Co Stripping Column adalah kolom pemisahan akhir dimana larutan cobalt dari Li, Ni Scrubber Column diproses menggunakan H2SO4 (asam sulfat) untuk mengekstrak cobalt dari fase organik ke fase air. Proses stripping ini menghasilkan CoSO4 (kobalt sulfat) sebagai produk akhir, sementara pelarut organik PC-88A yang telah dikosongkan akan didaur ulang kembali ke proses Co Solvent Extraction. Proses ini merupakan tahap pemurnian terakhir untuk mendapatkan kobalt dalam bentuk yang dapat digunakan kembali untuk produksi baterai baru.' }, '*');
    });
    document.getElementById('nseButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Ni Solvent Extraction', p: 'Ni Solvent Extraction adalah proses pemisahan menggunakan pelarut organik PC-88A yang menghasilkan dua aliran utama: aliran kaya nikel yang akan diproses melalui Li Scrubber Column dan Ni Stripping Column untuk menghasilkan NiSO4, serta aliran lithium yang diteruskan ke Li Settling Tank untuk menghasilkan Li2CO3. Proses ini melibatkan daur ulang dimana hasil pemisahan dari Li Scrubber Column dikembalikan ke Ni Solvent Extraction, sementara PC-88A yang telah digunakan juga didaur ulang untuk memaksimalkan efisiensi proses pemurnian logam dari baterai bekas.' }, '*');
    });
    document.getElementById('lstButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Li Settling Tank', p: 'Li Settling Tank adalah tangki pengendapan yang menerima aliran lithium dari Ni Solvent Extraction dan Na2CO3 (natrium karbonat) jenuh. Dalam tangki ini, lithium akan bereaksi dengan Na2CO3 membentuk Li2CO3 (lithium karbonat) yang mengendap dan dipisahkan sebagai produk. Proses ini menghasilkan dua aliran output: Li2CO3 sebagai produk yang dapat digunakan kembali dan aliran untuk waste treatment.' }, '*');
    });
    document.getElementById('lscButton').addEventListener('click', function() {
        parent.postMessage({ type: 'changeText', h1: 'Li Scrubber Column', p: 'Li Scrubber Column adalah kolom pemisahan yang menerima aliran kaya nikel dari Ni Solvent Extraction dan Na2CO3 0.1 M sebagai scrubbing agent. Kolom ini berfungsi untuk memisahkan sisa lithium yang masih terbawa dalam aliran nikel, dimana hasil pemisahan berupa scrub raffinate akan didaur ulang kembali ke Ni Solvent Extraction untuk memaksimalkan perolehan nikel, sementara aliran yang kaya nikel akan diteruskan ke Ni Stripping Column untuk proses pemurnian menjadi NiSO4.' }, '*');
    });
    document.getElementById('nscButton').addEventListener('click', function() {
        parent.postMessage({ type: 'buttonClicked', h1: 'Ni Stripping Column', p: 'Ni Stripping Column adalah kolom pemisahan akhir dimana aliran kaya nikel dari Li Scrubber Column diproses menggunakan H2SO4 (asam sulfat) untuk mengekstrak nikel dari fase organik ke fase air. Proses stripping ini menghasilkan NiSO4 (nikel sulfat) sebagai produk akhir, sementara pelarut organik PC-88A yang telah dikosongkan akan didaur ulang kembali ke proses Ni Solvent Extraction. Proses ini merupakan tahap pemurnian terakhir untuk mendapatkan nikel dalam bentuk yang dapat digunakan kembali untuk produksi baterai baru.' }, '*');
    });
});
